import React from 'react';
import "./Portfolio"

export default function Portfolio() {
  return (
    <div className="portfolio" id='portfolio'>
      <h1>Portfolio</h1>
      <ul>
        <li>Featured</li>
        <li>Web App</li>
        <li></li>
      </ul>
      
    </div>
  )
}
